function printObjectInTable(e,t){var n=document.getElementById(t).getElementsByTagName("th"),r=n.length,i=document.createElement("tr");for(var s=0;s<n.length;s++){var o=n[s];var u=document.createElement("td");if(e.hasOwnProperty(o.id)){u.appendChild(document.createTextNode(e[o.id]))}i.appendChild(u)}document.getElementById(t).getElementsByTagName("tbody")[0].appendChild(i)}